import org.apache.nifi.processor.io.StreamCallback
import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import java.nio.charset.StandardCharsets
import java.time.ZoneId
import java.time.ZonedDateTime
import java.time.format.DateTimeFormatter

def flowFile = session.get()
if(!flowFile) return

// IST timezone
def istZone = ZoneId.of("Asia/Kolkata")
def formatter = DateTimeFormatter.ofPattern("yyyy-MM-dd HH:mm:ss").withZone(istZone)

// Compute IST start and end time for current day
def nowIst = ZonedDateTime.now(istZone)
def startTimeStr = nowIst.withHour(0).withMinute(0).withSecond(1).withNano(0).format(formatter)
def endTimeStr   = nowIst.withHour(23).withMinute(59).withSecond(59).withNano(0).format(formatter)
def createdAtStr = nowIst.format(formatter)          //  Add created_at timestamp
def updatedAtStr = createdAtStr                     // Optional: updated_at also same

flowFile = session.write(flowFile, { inputStream, outputStream ->

    def jsonText = inputStream.getText('UTF-8')
    def data = new JsonSlurper().parseText(jsonText)
    def transformed = []

    data.each { record ->
        // Extract top-level fields
        def queueId = record.queueId ?: ""
        def queueName = record.name ?: ""
        def siteId = record.siteId ?: ""
        def timeZoneId = record.timeZoneId ?: "Asia/Kolkata"

        // Extract floors and zones as comma-separated strings
        def floors = (record.floors ?: []).join(",")
        def zones = (record.zones ?: []).join(",")

        // Flatten gates
        record.gates?.each { gateKey, gateVal ->
            def gateName = gateVal.name ?: ""
            def gateServerNames = (gateVal.serverNames ?: []).join(",")
            def gateLaneNames = (gateVal.laneNames ?: []).join(",")

            transformed << [
                queue_id          : queueId,
                queue_name        : queueName,
                site_id           : siteId,
                time_zone_id      : timeZoneId,
                gate_key          : gateKey,
                gate_name         : gateName,
                gate_server_names : gateServerNames,
                gate_lane_names   : gateLaneNames,
                floors            : floors,
                zones             : zones,
                start_time        : startTimeStr,
                end_time          : endTimeStr,
                created_at        : createdAtStr,     //  Added
                updated_at        : updatedAtStr      // Optional
            ]
        }

        // Flatten lanes
        record.lanes?.each { laneKey, laneVal ->
            def laneName = laneVal.name ?: ""
            def laneServerNames = (laneVal.serverNames ?: []).join(",")
            def laneGateNames = (laneVal.gateNames ?: []).join(",")

            transformed << [
                queue_id          : queueId,
                queue_name        : queueName,
                site_id           : siteId,
                time_zone_id      : timeZoneId,
                lane_key          : laneKey,
                lane_name         : laneName,
                lane_server_names : laneServerNames,
                lane_gate_names   : laneGateNames,
                floors            : floors,
                zones             : zones,
                start_time        : startTimeStr,
                end_time          : endTimeStr,
                created_at        : createdAtStr,     //  Added
                updated_at        : updatedAtStr      // Optional
            ]
        }

        // Flatten servers
        record.servers?.each { serverKey, serverVal ->
            def serverName = serverVal.name ?: ""
            def serverActive = serverVal.active ?: false
            def serverLaneNames = (serverVal.laneNames ?: []).join(",")

            transformed << [
                queue_id          : queueId,
                queue_name        : queueName,
                site_id           : siteId,
                time_zone_id      : timeZoneId,
                server_key        : serverKey,
                server_name       : serverName,
                server_active     : serverActive,
                server_lane_names : serverLaneNames,
                floors            : floors,
                zones             : zones,
                start_time        : startTimeStr,
                end_time          : endTimeStr,
                created_at        : createdAtStr,     //  Added
                updated_at        : updatedAtStr      // Optional
            ]
        }
    }

    // Write formatted JSON output
    outputStream.write(JsonOutput.prettyPrint(JsonOutput.toJson(transformed)).getBytes(StandardCharsets.UTF_8))

} as StreamCallback)

session.transfer(flowFile, REL_SUCCESS)
